import React, { useState, useEffect } from "react";

import useFetch from "./useFetch";

export default function DataFetch() {
  const { data, isLoading, error } = useFetch(
    "https://jsonplaceholder.typicode.com/todos?_limit=10"
  );
  const loadingMessage = <p>Todos is loading</p>;
  const errorMessage = <p>{error}</p>;

  const todosElement =
    data &&
    data.map((todo) => {
      return <p key={todo.id}>{todo.title}</p>;
    });
  console.log(todosElement);
  return (
    <div>
      <h1>
        Custom Hooks is used for reuse the code. It is used for difference API's
      </h1>
      <p className="">React JS Custom hooks is as like as JavaScript function</p>
      {error && errorMessage}
      {isLoading && loadingMessage}
      {todosElement}
    </div>
  );
}
